	[16103] = {16103, 16022, 0, 0, 1, 0, {}, {}, 0, 0, {}, 0, 1, 1, 1, 9999, 5, 2, {{114,0},{124,0}}, 2, {37,6,1}, 1, {{10460,3}}, "<div fontcolor=#9e501b>Smartness:</div> Ignore all the slowing effects; at the beginning of each round, for every friend Fang Pokémon of the same family, the speed increases by 3%/6%/9%/11% in turn (not possible Coexist with [Swift], take effect first)\nMake Pokémon <div fontcolor=#9e501b>comprehension</div> or <div fontcolor=#9e501b>upgrade</div><div fontcolor=#9e501b> \"smart \"</div> Awakening talent, Pokémon will start Awakening in <div fontcolor=#9e501b>13star</div>", "Dexterity Talent Stone", "Skill props", "Role: Awakening talent learning"},
	[16104] = {16104, 16013, 0, 0, 1, 0, {}, {}, 0, 0, {}, 0, 1, 1, 1, 9999, 5, 2, {{114,0},{124,0}}, 2, {37,6,1}, 1, {{10460,3}}, "<div fontcolor=#9e501b>Sanctions:</div> During the attack, the target will receive an additional damage value of 3% of its life limit* (not exceeding 30% of the damage value of the skill received this time)\nCan make Pokémon< div fontcolor=#9e501b>Comprehension</div> or <div fontcolor=#9e501b>Upgrade</div><div fontcolor=#9e501b>\"Sanction\"</div> Awakening talent, Pokémon will be available in <div fontcolor= #9e501b>13star</div>Start Awakening", "Sanction Talent Stone", "Skill props", "Role: Awakening talent learning"},
	[16105] = {16105, 16012, 0, 0, 1, 0, {}, {}, 0, 0, {}, 0, 1, 1, 1, 9999, 5, 2, {{114,0},{124,0}}, 2, {37,6,1}, 1, {{10460,3}}, "<div fontcolor=#9e501b>Faith:</div> When one\'s own life is 50% or more, the physical damage taken is reduced by 5%; when it is below 50%, the Heal received is increased by 10%\nCan make Pokémon<div fontcolor =#9e501b>Comprehension</div> or <div fontcolor=#9e501b>Upgrade</div><div fontcolor=#9e501b>\"Faith\"</div> Awakening talent, Pokémon will be available in <div fontcolor=#9e501b >13star</div> to start awakening", "Faith Talent Stone", "Skill props", "Role: Awakening talent learning"},
	[16106] = {16106, 16005, 0, 0, 1, 0, {}, {}, 0, 0, {}, 0, 1, 1, 1, 9999, 5, 2, {{114,0},{124,0}}, 2, {37,6,1}, 1, {{10460,3}}, "<div fontcolor=#9e501b>Sanctuary:</div> After a teammate suffers a fatal injury and dies, he will send 10% of his own life to shelter him. If his blood is lower than 40%, it will not trigger. Cool down for 4 rounds. \nCan make Pokémon <div fontcolor=#9e501b> comprehend</div> or <div fontcolor=#9e501b> upgrade</div><div fontcolor=#9e501b>\"Sanctuary\"</div> Awakening talent, treasure The dream will start the awakening at <div fontcolor=#9e501b>13star</div>", "Asylum Talent Stone", "Skill props", "Role: Awakening talent learning"},
